import{_ as t,b as a,e as i,o as e,aJ as o,j as s}from"./chunks/framework.7oTv8epM.js";const n=JSON.parse('{"title":"下载安装","description":"","frontmatter":{"title":"下载安装"},"headers":[],"relativePath":"product/getting-started/download-install.md","filePath":"product/getting-started/download-install.md"}');const h=t({name:"product/getting-started/download-install.md"},[["render",function(t,n,h,p,r,l){const u=a("NolebaseGitContributors"),g=a("NolebaseGitChangelog");return e(),i("div",null,[n[0]||(n[0]=o('<h2 id="下载安装" tabindex="-1">下载安装 <a class="header-anchor" href="#下载安装" aria-label="Permalink to &quot;下载安装&quot;">​</a></h2><h3 id="下载客户端" tabindex="-1">下载客户端 <a class="header-anchor" href="#下载客户端" aria-label="Permalink to &quot;下载客户端&quot;">​</a></h3><p>1.访问官网在上方菜单栏点击下载中心</p><p><img src="/assets/image1.AmqmqgJ_.png" alt="">{width=&quot;5.761111111111111in&quot; height=&quot;2.707638888888889in&quot;}</p><p>2.软件下载完成后，以 windows 电脑为例，进入下载文件的路径，双击运行。</p><p><img src="/assets/image2.BTWMeY14.png" alt="">{width=&quot;5.767361111111111in&quot; height=&quot;0.6576388888888889in&quot;}</p><p>3.安装并启动客户端</p><p>此页面即代表客户端安装完成</p><p><img src="/assets/image3.0pBIR7Io.png" alt="">{width=&quot;5.760416666666667in&quot; height=&quot;3.6430555555555557in&quot;}</p><h3 id="安装说明" tabindex="-1">安装说明 <a class="header-anchor" href="#安装说明" aria-label="Permalink to &quot;安装说明&quot;">​</a></h3><h4 id="mac有2个安装包-怎么选择" tabindex="-1">Mac有2个安装包，怎么选择？ <a class="header-anchor" href="#mac有2个安装包-怎么选择" aria-label="Permalink to &quot;Mac有2个安装包，怎么选择？&quot;">​</a></h4><p>Mac电脑分为Intel（因特尔）芯片和Apple（苹果）芯片2种类型，点击桌面左上角的苹果图标，选择 【 关于本机 】 可以查看Mac电脑的芯片，如下图示就是Apple芯片的Mac电脑：</p><p><img src="/assets/image5.47ZiKIrc.png" alt="image" width="5.759722222222222in" height="6.85in"></p><p>在下载页面要选择下载Mac（Apple芯片）版。<img src="/assets/image6.BjGbiLh7.png" alt="">{width=&quot;5.7555555555555555in&quot; height=&quot;2.560416666666667in&quot;}</p><h3 id="注册登录" tabindex="-1">注册登录 <a class="header-anchor" href="#注册登录" aria-label="Permalink to &quot;注册登录&quot;">​</a></h3><h4 id="会员账号注册" tabindex="-1">会员账号注册 <a class="header-anchor" href="#会员账号注册" aria-label="Permalink to &quot;会员账号注册&quot;">​</a></h4><p>在官网点击【登录】、【免费试用】，进入注册GtChat会员账号页面</p><p><img src="/assets/image7.DKw734Rv.png" alt="" width="5.746527777777778in" height="2.4375in"></p><p>新用户点击【去注册】，进行会员账号注册，用于登录会员平台</p><p><img src="/assets/image8.CUL6vusb.png" alt="">{width=&quot;5.752083333333333in&quot; height=&quot;3.0368055555555555in&quot;}</p><p>支持邮箱注册</p><p><img src="/assets/image9.nHvHwAX3.png" alt="">{width=&quot;5.752777777777778in&quot; height=&quot;3.0722222222222224in&quot;}</p><p>未收到邮箱验证码，请查看邮箱【回收站】~【垃圾箱】</p><h4 id="会员账号登录" tabindex="-1">会员账号登录 <a class="header-anchor" href="#会员账号登录" aria-label="Permalink to &quot;会员账号登录&quot;">​</a></h4><p>在官网点击【登录】，进入GtChat会员账号登录页面</p><p><img src="/assets/image10.DWgc3xru.png" alt="">{width=&quot;5.768055555555556in&quot; height=&quot;2.5625in&quot;}输入邮箱账号和密码点击登录。</p><p><img src="/assets/image11.TZfDi7pI.png" alt="">{width=&quot;5.764583333333333in&quot; height=&quot;3.115972222222222in&quot;}</p><h4 id="购买套餐" tabindex="-1">购买套餐 <a class="header-anchor" href="#购买套餐" aria-label="Permalink to &quot;购买套餐&quot;">​</a></h4><p>GtChat账号注册完成后登录管理后台可以直接购买套餐</p><p>登录管理后台在【首页】可以直接看到当前的套餐规格和有效期，点击【购买套餐】可以查看不同套餐的定价</p><p><img src="/assets/image12.Blqb6Vs-.png" alt="">{width=&quot;5.761111111111111in&quot; height=&quot;1.8666666666666667in&quot;}</p><p><img src="/assets/image13.D0C_eF_K.png" alt="">{width=&quot;5.759722222222222in&quot; height=&quot;3.8340277777777776in&quot;}</p><p>点击切换套餐可对比</p><p>修改套餐规格，实时查看不同端口数、不同时间的套餐价格</p><p>使用余额抵扣部分套餐金额，3种可选支付方式</p><p>点击【立即支付】发起付款</p><p>注：支付走的是第三方平台，买卖双方均需支付部分手续费，实际付款的金额会大于套餐的标定金额，按照实际显示的金额完整支付，套餐会自动到账。</p>',37)),s(u),s(g)])}]]);export{n as __pageData,h as default};
